import java.io.*
import jxl.*

def f = new File("C:\\Soap\\sampleexcel1.xls")
def wb = Workbook.getWorkbook(f)
def ws = wb.getSheet("Sheet1")
def r = ws.getRows()

for (def i=1;i<r;i++)
{
    Cell c1 = ws.getCell(3,i)
    if (c1.getContents().equalsIgnoreCase("y"))
    {
        Cell c2 = ws.getCell(1,i)
        testRunner.testCase.testSuite.setPropertyValue("test data",c2.getContents())
        Cell c22 = ws.getCell(2,i)
        testRunner.testCase.testSuite.setPropertyValue("test data",c22.getContents())
        Cell c3 = ws.getCell(0,i)
        testRunner.runTestStepByName(c3.getContents())

    }

}
